import React from 'react';
import {Button, Container} from 'react-bootstrap';
import './App.css';

let App = () => {
  return (
    <Container fluid>
      <Container className='text-center'>
        <h1>DocTalk</h1>
        <Button variant='info' classname="mt-3" href='#'>Sign In!</Button>
      </Container>
    </Container>
  );
}

export default App;
